import React from 'react'
import Image from 'next/image'


export default class Player extends React.Component {

    constructor() {
        super()
        this.state = {
            hp: 10,
            hpLength: new Array(10),
        }
    }

    render() {

        return (
            <div>
                <Image src='/Assets/met.g' alt='hero' width={100} height={100} />

                <div>
                    {
                        this.state.hpLength.map(hp => <p>|</p>)
                    }
                </div>
            </div>
        )
    }
}
